mongodb Aggregate for already grouped distinct combination (grouping inside grouping)<p>I am using mongoDB in which I have collection of following format.</p>

<pre><code>{name : x  city : AAA , status : active , radius : 1 }
{name : x  city : AAA , status : active , radius : 4  }
{name : x  city : AAA , status : inactive , radius : 7 }
{name : x  city : BBB , status : inactive , radius : 7 }
{name : Y  city : AAA , status : active , radius : 8 }
{name : Y  city : BBB , status : inactive , radius : 5 }
{name : Y  city : BBB , status : inactive , radius : 12 }
{name : Z  city : CCC , status : deleted , radius : 15 }
</code></pre>

<p>Now I want unique combination of <strong>name</strong> and <strong>class</strong> and for that combination also required a sub-grouping of active , inactive and deleted count for status field. thus the overall out-put report will be in below format</p>

<pre><code>Name  City  total  Active  Inactive deleted 
 X     AAA    3     2       1         0
 X     BBB    1     0       1         0
 Y     AAA    1     1       0         0
 Y     BBB    2     0       2         0
 Z     CCC    1     0       0         1
</code></pre>

<p>As I am new to mongodb thus can any one suggest that is there any way to get the required output format using aggregate or any other method with minimal query ? </p>

