Hard time understanding gridfs and connections<p>So I watched this video: <a href="https://youtu.be/EVIGIcm7o2w" rel="nofollow noreferrer">https://youtu.be/EVIGIcm7o2w</a></p>

<p>And it explained a lot of stuff. But the problem is I already have a project created with <code>Express</code> so my connection is done in app.js like this:</p>

<pre><code>// mongodb connection
var mongoose = require('mongoose');
var config = require('./globals/config');
mongoose.connect(config.db, {useNewUrlParser: true},).catch(e =&gt; console.log(e));

var db = mongoose.connection;
db.once('open', () =&gt; {
    console.log('Connected to mongodb. Go to http://localhost:3000 to open app');
});
</code></pre>

<p>Now I want to use gridFS, <strong><em>in a different file</em></strong> to upload files to my db, and I tried this:</p>

<pre><code>var grid = require('gridfs-stream');
var mongoose = require('mongoose');
var fs = require('fs');
uploadFile(file) {
    var config = require('./config');
    mongoose.connect(config.db, {useNewUrlParser: true},).catch(e =&gt; console.log(e));
    var conn = mongoose.connection;
    grid.mongo = mongoose.mongo;
    const gfs = grid(conn.db);
    const writeStream = gfs.createWriteStream({
        filename: file.filename,
    });
    fs.createReadStream(file.path).pipe(writeStream);
    writeStream.on('close', function (file) {
        console.log(`${file.filename} written to the db`);
    });
}
</code></pre>

<p>But this makes no sense, since I'm reopening 2 connections. I looked at mongoose-gridfs, but it also showed using it in sort of "app.js" no cross-file way of doing things. How do I use gridfs without opening 2 connections and using 2 different js files?</p>

